import React from 'react';

const HomePage = () => {
  const openToDoPage = () => {
    window.open('/todo', '_blank'); // Opens the To-Do page in a new tab
  };

  return (
    <div className="container">
      <h1>Welcome to To-Do App</h1>
      <button onClick={openToDoPage} className="btn btn-primary">Login</button>
      <a href="/login" className="btn btn-secondary">Sign Up</a>
    </div>
  );
};

export default HomePage;
